    const [summary, setSummary] = useState('');
    const [description, setDescription] = useState('');

    return (
        <form>
            <div>
            <label>
                Summary
                <input type="text" name="summary" className="label-input"/>
            </label>
            </div>

            <div>
            <label>
                Description
                <input type="text" name="description" className="label-input"/>
            </label>
            </div>
            <div className='create-btn'>
            <button>Create!</button>
            </div>
        </form>
    );
}

export default IssueForm;
